ity &amp;&amp; max !== -Infinity) {\n            pad = pad ? (max - min) * .03 : 0;\n            range.start = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"301046","type":"CustomJS"},{"attributes":{"border_line_color":"#333333","click_policy":"hide","coordinates":null,"glyph_width":0,"group":null,"items":[{"id":"301041"}],"label_text_font_size":"8pt","location":"top_left","margin":0,"padding":5,"spacing":0},"id":"301040","type":"Legend"},{"attributes":{"below":[{"id":"300999"}],"center":[{"id":"301002"},{"id":"301006"},{"id":"301040"}],"height":90,"left":[{"id":"301003"}],"min_border_bottom":6,"min_border_left":0,"min_border_right":10,"min_border_top":3,"outline_line_color":"#666666","renderers":[{"id":"301027"}],"sizing_mode":"stretch_width","title":{"id":"301029"},"toolbar":{"id":"301015"},"toolbar_location":null,"width":null,"x_range":{"id":"300641"},"x_scale":{"id":"300995"},"y_range":{"id":"300993"},"y_scale":{"id":"300997"}},"id":"300991","subtype":"Figure","type":"Plot"},{"attributes":{"coordinates":null,"data_source":{"id
